import React, { useState } from "react";
import ProjectAreaTwoItem from "./ProjectAreaTwoItem";
import cn from "classnames";

const ProjectAreaTwo = () => {
  const project_items = [
    {
      id: "dms",
      url: "/project-details/dms",
      src: "/img/project/DMC/Screenshot 2025-05-04 at 14.53.53.png",
      title: "Dentist Management System",
      desc: "This project is a dentist management system that allows dentists to manage their patients, appointments, and other data.",
      className: "cat-one",
      details: {
        fullDescription: "A comprehensive dental practice management system that streamlines patient care, appointment scheduling, and administrative tasks. Features include patient records management, appointment scheduling, billing and invoicing, treatment planning, and reporting tools.",
        technologies: ["React", "Node.js", "MongoDB", "Express"],
        features: ["Patient Management", "Appointment Scheduling", "Billing System", "Treatment Planning"],
        image: "/img/project/DMC/Screenshot 2025-05-04 at 14.53.53.png"
      }
    },
    {
      id: "aop",
      url: "/project-details/aop",
      src: "/img/project/AOP/Screenshot 2025-01-28 at 19.26.25.png",
      title: "Academic Orientation platform",
      desc: "This project is a platform that allows students to get information about the university and the courses they offer.",
      className: "cat-two",
      details: {
        fullDescription: "An innovative platform designed to help students navigate their academic journey. The system provides comprehensive information about university programs, course requirements, and career paths.",
        technologies: ["React", "Firebase", "Material-UI"],
        features: ["Course Catalog", "Student Dashboard", "Career Guidance", "Interactive Maps"],
        image: "/img/project/AOP/Screenshot 2025-01-28 at 19.26.25.png"
      }
    },
    {
      id: "erp",
      url: "/project-details/erp",
      src: "/img/project/ERP/Screenshot 2025-05-04 at 14.57.21.png",
      title: "Entreprise resource Planning",
      desc: "This project is a platform that allows companies to manage their resources and their employees.",
      className: "cat-two cat-one",
      details: {
        fullDescription: "A comprehensive enterprise resource planning system that helps businesses manage their operations efficiently. The platform integrates various business processes into a unified system.",
        technologies: ["React", "Node.js", "PostgreSQL", "Docker"],
        features: ["Resource Management", "Employee Portal", "Inventory Control", "Financial Management"],
        image: "/img/project/ERP/Screenshot 2025-05-04 at 14.57.21.png"
      }
    },
    {
      id: "rms",
      url: "/project-details/rms",
      src: "img/project/RMS/Screenshot 2025-01-28 at 19.36.36.png",
      title: "Restaurant Management System",
      desc: "This project is a platform that allows restaurants to manage their customers, orders, and other data.",
      className: "cat-three",
      details: {
        fullDescription: "A complete restaurant management solution that streamlines operations from order taking to inventory management. The system helps restaurants improve efficiency and customer service.",
        technologies: ["React", "Node.js", "MySQL", "Socket.io"],
        features: ["Order Management", "Inventory Tracking", "Customer Database", "Analytics Dashboard"],
        image: "img/project/RMS/Screenshot 2025-01-28 at 19.36.36.png"
      }
    },
  ];

  const filters = [
    {
      filter: "*",
      label: "View All",
    },
    {
      filter: "cat-one",
      label: "App",
    },
    {
      filter: "cat-two",
      label: "Website",
    },
    {
      filter: "cat-three",
      label: "Landing Page",
    }
  ];

  const [selectedFilter, setSelectedFilter] = useState("*");

  const [items, setItems] = useState(project_items);

  const handleFilterChange = (filter) => {
    const newItems = project_items.filter((el) =>
      el.className.split(" ").includes(filter)
    );
    setSelectedFilter(filter);
    setItems(filter === "*" ? project_items : newItems);
  };

  return (
    <section className="project-area-two pt-110 pb-90">
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-xl-7 col-lg-9">
            <div className="section-title title-style-two white-title mb-60 text-center">
              <span className="sub-title">Portfolio</span>
              <h2 className="title">You Will Like These Projects Made by Me</h2>
              <p>
                Here are some of the projects I have worked on. I have worked on these projects using different technologies and frameworks.
              </p>
            </div>
          </div>
        </div>

        <div className="project-item-wrap">
          <div className="row">
            <div className="col-lg-12">
              <div className="project-menu-nav">
                {filters.map((x, index) => (
                  <button
                    key={index}
                    className={x.filter === selectedFilter ? "active" : ""}
                    data-filter={x.filter}
                    onClick={() => handleFilterChange(x.filter)}
                  >
                    {x.label}
                  </button>
                ))}
              </div>
            </div>
          </div>

          <div className="row project-active-two">
            {items.map((x, index) => (
              <div
                key={index}
                className={cn(
                  "col-lg-6 col-md-6 grid-item grid-sizer wow fadeInUp",
                  x.className
                )}
              >
                <ProjectAreaTwoItem item={x} />
              </div>
            ))}
          </div>
        </div>
      </div>

      <div className="project-shape">
        <img src="/img/project/h2_project_shape.png" alt="" />
      </div>
    </section>
  );
};

export default ProjectAreaTwo;
